import React from 'react';
import { Box, Button } from '@material-ui/core';

export default class Policy extends React.Component {

  render() {
    return (
        <Box
        color="red"
        bgcolor="#90a4ae"
        >
          <Button>
            {this.props.text}
          </Button>
        </Box>
    );
  }
}
